INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106001, 1, 7, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 7001, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", -363.0, "2030/12/17 14:59:59", "キャル");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 7, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 7002, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", -363.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 7, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 7003, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", -363.0, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 10, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 10001, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", -363.0, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106001, 1, 10, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 10002, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", -363.0, "2030/12/17 14:59:59", "キャル");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 10, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 10003, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", -363.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106401, 1, 10, 0, 0.0, 2104010, 0.0, 1, 2, "2015/12/17 15:00:00", 10004, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", -363.0, "2030/12/17 14:59:59", "シェフィ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 12, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 12001, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", -416.5, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106001, 1, 13, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 13001, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", -363.0, "2030/12/17 14:59:59", "キャル");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 13, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 13002, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", -363.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106401, 1, 13, 0, 0.0, 2104010, 0.0, 1, 2, "2015/12/17 15:00:00", 13003, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", -363.0, "2030/12/17 14:59:59", "シェフィ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 13, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 13004, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", -363.0, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 14, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 14001, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", -363.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106401, 1, 14, 0, 0.0, 2104010, 0.0, 1, 2, "2015/12/17 15:00:00", 14002, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", -363.0, "2030/12/17 14:59:59", "シェフィ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 14, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 14003, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", -363.0, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106001, 1, 14, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 14004, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", -363.0, "2030/12/17 14:59:59", "キャル");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 15, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 15001, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", -470.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106401, 1, 16, 0, 0.0, 2104010, 0.0, 1, 2, "2015/12/17 15:00:00", 16001, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", -363.0, "2030/12/17 14:59:59", "シェフィ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 16, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 16002, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", -363.0, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106001, 1, 16, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 16003, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", -363.0, "2030/12/17 14:59:59", "キャル");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 16, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 16004, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", -363.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 17, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 17002, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", -363.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106001, 1, 25, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 17004, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", -363.0, "2030/12/17 14:59:59", "キャル");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 25, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 17005, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", -363.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106401, 1, 25, 0, 0.0, 2104010, 0.0, 1, 2, "2015/12/17 15:00:00", 17006, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", -363.0, "2030/12/17 14:59:59", "シェフィ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 25, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 17007, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", -363.0, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 1, 18, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 18001, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", -363.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 2, 18, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 18002, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", -363.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 3, 19, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 19001, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", -470.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 4, 19, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 19002, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", -470.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 5, 20, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 20001, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", -470.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 6, 20, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 20002, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", -470.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106001, 1, 21, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 21001, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", -363.0, "2030/12/17 14:59:59", "キャル");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 21, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 21002, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", -363.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106401, 1, 21, 0, 0.0, 2104010, 0.0, 1, 2, "2015/12/17 15:00:00", 21003, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", -363.0, "2030/12/17 14:59:59", "シェフィ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 21, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 21004, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", -363.0, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 1, 22, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 22001, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", -430.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 2, 22, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 22002, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", -430.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 3, 23, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 23001, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", -430.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (190801, 4, 23, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 23002, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", -430.0, "2030/12/17 14:59:59", "カリン");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109001, 1, 24, 10011, 8.0, 0, 4.08, 2, 1, "2019/01/31 12:00:00", 24001, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109001, 2, 24, 10011, 8.0, 0, 5.0, 2, 1, "2019/01/31 12:00:00", 24002, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109001, 3, 24, 10011, 8.0, 0, 10.11, 2, 1, "2019/01/31 12:00:00", 24003, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109001, 4, 24, 10011, 8.0, 0, 4.0, 2, 1, "2019/01/31 12:00:00", 24004, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109001, 5, 24, 10011, 8.0, 0, 6.0, 2, 1, "2019/01/31 12:00:00", 24005, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", -385.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109002, 6, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24006, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109002, 7, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24007, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109002, 8, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24008, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109002, 9, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24009, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109002, 10, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24010, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, "2030/12/17 14:59:59", "エリコ（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109101, 1, 24, 10011, 8.0, 0, 2.12, 2, 1, "2019/01/31 12:00:00", 24011, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109101, 2, 24, 10011, 8.0, 0, 4.19, 2, 5, "2019/01/31 12:00:00", 24012, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109101, 3, 24, 10011, 8.0, 0, 2.3, 4, 2, "2019/01/31 12:00:00", 24013, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109102, 4, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24014, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109101, 5, 24, 10011, 8.0, 0, 5.23, 2, 5, "2019/01/31 12:00:00", 24015, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109102, 6, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24016, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109101, 7, 24, 10011, 8.0, 0, 5.01, 2, 1, "2019/01/31 12:00:00", 24017, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", -385.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109102, 8, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24018, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109102, 9, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24019, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (109102, 10, 24, 10011, 0.0, 0, 0.0, 1, 1, "2019/01/31 12:00:00", 24020, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, "2030/12/17 14:59:59", "シズル（バレンタイン）");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106401, 1, 26, 0, 0.0, 2104010, 0.0, 1, 2, "2015/12/17 15:00:00", 26001, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", -363.0, "2030/12/17 14:59:59", "シェフィ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 26, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 26002, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", -363.0, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106001, 1, 26, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 26003, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", -363.0, "2030/12/17 14:59:59", "キャル");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105901, 1, 26, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 26004, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", -363.0, "2030/12/17 14:59:59", "コッコロ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106401, 1, 27, 0, 0.0, 2104010, 0.0, 1, 2, "2015/12/17 15:00:00", 27001, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", -363.0, "2030/12/17 14:59:59", "シェフィ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (105801, 1, 27, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 27002, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", -363.0, "2030/12/17 14:59:59", "ペコリーヌ");
INSERT INTO `v1_6c21c76d258c22a91f8d6afbaa3de527f02620a7120f030fba97b5df7395f3c6` VALUES (106001, 1, 27, 0, 0.0, 0, 0.0, 1, 1, "2015/12/17 15:00:00", 27003, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", -363.0, "2030/12/17 14:59:59", "キャル");
